    <script>
      const SIZE = 20

      const on = '#ff75aa'
      const off = 'rgb(248, 249, 250)'
      const toggle = color => color == off ? on : off

      document.addEventListener('click', e => {
        if (e.target.nodeName === 'path') {
          e.target.setAttribute('fill', toggle(e.target.getAttribute('fill')))
        }
      })
    </script>
